import React, {useState} from "react";
import Home from "./PortfolioContainer/Home/Home";
import Projects from "./PortfolioContainer/Projects/Projects";
import "./PortfolioContainer/Projects/Projects.css";
import "./PortfolioContainer/Home/Home.css";


import "./App.css";

function App() {
    const [page, setPage] = useState("Home")

    const pageHelper = () => {

        if (page != "Home"){
            setPage("Home")
        }

        console.log("hello")
    }


    const [projectPage, setProjectsPage] = useState("Projects")

    const projectsPageHelper = () => {
            if(projectPage != "Projects"){
                setProjectsPage("Projects")
            }

        console.log("hello")
    }

    return (
            <>
            <button onClick={() => pageHelper()}>Home</button>
            <button onClick={() => projectsPageHelper()}>Projects</button>

            <div className="App">
                {(page === "Home") && <Home />}
                {(projectPage === "Projects") && <Projects />}











            </div>

            </>

    );
}

export default App;
